import React from "react";
import Headerplus from "./components/Headerplus";
import Down from "./components/Down";
import FitnessCenterIcon from "@material-ui/icons/FitnessCenter";


function Join() {
  return (
    <div>
      <Headerplus />
      <div>
      <FitnessCenterIcon />
      <form>
       <h5>Email</h5>
       <input type='text'></input>
       <h5>Email</h5>
       <input type='text'></input>
      </form>
</div>
      <Down />
    </div>
  );
}

export default Join;
